INSERT INTO `config` VALUES (1,0,'<figure class=\"image ck-widget image-style-align-left\" contenteditable=\"false\"><img src=\"data:image/jpeg;base64,\" class=\"mCS_img_loaded\"><figcaption class=\"ck-editor__editable ck-editor__nested-editable\" data-placeholder=\"Enter image caption\" contenteditable=\"true\">نتنت</figcaption></figure><p>لورم ایپسوم متن ساختگی با تولید سادگی نامفهوم از صنعت چاپ، و با استفاده از طراحان گرافیک است، چاپگرها و متون بلکه روزنامه و مجله در ستون و سطرآنچنان که لازم است، و برای شرایط فعلی تکنولوژی مورد نیاز، و کاربردهای متنوع با هدف بهبود ابزارهای کاربردی می باشد، کتابهای زیادی در شصت و سه درصد گذشته حال و آینده، شناخت فراوان جامعه و متخصصان را می طلبد، تا با نرم افزارها شناخت بیشتری را برای طراحان رایانه ای علی الخصوص طراحان خلاقی، و فرهنگ پیشرو در زبان فارسی ایجاد کرد، در این صورت می توان امید داشت که تمام و دشواری موجود در ارائه راهکارها، و شرایط سخت تایپ به پایان رسد و زمان مورد نیاز شامل حروفچینی دستاوردهای اصلی، و جوابگوی سوالات پیوسته اهل دنیای موجود طراحی اساسا مورد استفاده قرار گیرد.</p>',7,7,2,1,1,5,'shop'),(2,0,NULL,7,7,2,1,1,5,'event');
/*!40000 ALTER TABLE `config` ENABLE KEYS */;
UNLOCK TABLES;

