INSERT INTO `products` VALUES (11,'فرش دستباف 12 متری پورمعمار مدل شکارگاه کد 110','درخواست مرجوع کردن کالا در گروه فرش دستبافت با دلیل \"انصراف از خرید\" تنها در صورتی قابل تایید است که کالا در شرایط اولیه باشد (در صورت پلمپ بودن، کالا نباید باز شده باشد).','فرش دستبافت','فرش دستبافت','فرش دستباف 12 متری پورمعمار مدل شکارگاه کد 110',NULL,849900000,99,1,10,NULL,NULL,NULL,1,1,'/7i9Ld6IPAYjERfRUHBHyobEH6HlqJ3vZV6aKZ1cp.jpg','فرش دستباف 12 متری پورمعمار مدل شکارگاه کد 110',371,6,NULL,3,NULL,'<h3 style=\"text-align:justify;\">فرش دستباف چیست؟</h3><p style=\"text-align:justify;\">یکی از مهمترین تجهیزات و کالاها که از گذشته تا کنون اهمیت ویژه‌ای در زندگی انسان داشته است ، فرش و محصولات نساجی می‌باشد ؛ زیرا استفاده از این وسایل در ایجاد حس آسایش و آرامش انسان کمک شایانی می‌کند. حال در این بین یکی از بی‌نظیرترین و پرطرفدارترین انواع فرش ، فرش‌های دستباف هستند که جزو محصولات کهن ایرانی نیز به شمار می‌روند. در اینجا سوالی که ممکن است برای خریداران پیش بیاید این است که فرش دستباف چیست؟ دقت داشته باشید که کلمه فرش یک عبارت عربی است که به معنی گسترده می‌باشد و به مواردی چون قالی و پلاس اطلاق می‌شود. در نتیجه می‌توان گفت منظور از فرش دستباف ، زیراندازی می‌باشد که به وسیله دست از تار و پود بافته شده است که این امر طبیعتا موجب ایجاد طرح‌های بسیار زیبا بر روی آن می‌شود و طرفداران زیادی در سراسر دنیا دارد.</p><h3 style=\"text-align:justify;\">تاریخچه فرش دستباف</h3><p style=\"text-align:justify;\">با توجه به تاریخچه کهنی که در تولید فرش و قالی دستباف ایرانی وجود دارد در حال حاضر می‌توان گفت محصول بافته شده به دست هنرمندان ایرانی جزو بهترین و زیباترین نوع فرش در دنیا است که این امر از نظر کارشناسان بین‌المللی فرش تایید شده است. اما با وجود آنکه در سال ۱۳۲۸ شمسی اولین فرش‌های گره‌دار به عنوان پوشش اسب و یا در چادر صحرانشینان مورد استفاده قرار گرفته است و سپس در تولید این محصول پیشرفت‌های زیادی حاصل شده پژوهشگران اعتقاد دارند که آغاز شکوفایی هنر فرشبافی در ایران به قرن ۱۶ و ۱۷ میلادی بر می‌گردد.</p><p style=\"text-align:justify;\">در سال‌های گذشته با پیشرفت تکنولوژی در بسیاری از زمینه‌ها از جمله زمینه تولید فرش ، شاهد تغییر و تحولات بسیار عظیمی در تولید این محصول بودیم ؛ به طوری که در ابتدای تولید فرش به دست هنرمندان ایرانی ، نقش‌های بسیار ساده و طرح‌های آسانی روی این محصولات نساجی پیاده می‌شد اما با گذشت زمان تحول شگرفی در تولید این محصول به وجود آمد و این امر موجب تنوع بی‌نظیر در بازار فرش دستباف شد.</p><h3 style=\"text-align:justify;\">فرش‌های دستباف تاریخی</h3><p style=\"text-align:justify;\">در میان فرش‌های مهم دستباف در تاریخ ایران می‌توان به فرش و قالی‌های ذیل اشاره کرد :</p><figure class=\"image ck-widget\" contenteditable=\"false\"><img src=\"https://ziloome.com/wp-content/uploads/2019/03/handmade-carpet-2.jpg\" alt=\"فرش‌های دستباف تاریخی\" srcset=\"https://ziloome.com/wp-content/uploads/2019/03/handmade-carpet-2.jpg 660w, https://ziloome.com/wp-content/uploads/2019/03/handmade-carpet-2-510x307.jpg 510w, https://ziloome.com/wp-content/uploads/2019/03/handmade-carpet-2-150x90.jpg 150w, https://ziloome.com/wp-content/uploads/2019/03/handmade-carpet-2-300x180.jpg 300w\" sizes=\"100vw\" width=\"660\" class=\"mCS_img_loaded\"><figcaption class=\"ck-editor__editable ck-editor__nested-editable ck-placeholder ck-hidden\" contenteditable=\"true\" data-placeholder=\"Enter image caption\"><br data-cke-filler=\"true\"></figcaption></figure><ol><li style=\"text-align:justify;\"><strong>قالی پازیریک :</strong> این فرش قدمتی ۲۵۰۰ ساله دارد و در اندازه‌های ۲۱۰ در ۱۸۳ سانتیمتر و با حدود ۳۶۰۰ گره بافته شده است.</li><li style=\"text-align:justify;\"><strong>فرش بهارستان :</strong> معروف به فرش بهار خسرو که یک قالی بسیار عالی در زمان خسرو پرویز می‌باشد.</li><li style=\"text-align:justify;\"><strong>قالی دستباف عصر صفوی :</strong> یکی دیگر از زیباترین قالی‌های دستباف ایرانی بوده که خلاقیت و نبوغ هنرمندان در زمان حکومت صفویان را نشان می‌دهد ، در این دوره قالیبافان با استفاده از طرح‌هایی در حدود ۱۵۰۰ تخته فرش و قالی از خود به جا گذاشته اند.</li><li style=\"text-align:justify;\"><strong>قالی ترنج منظره حیوانات :</strong> یکی دیگر از فرش‌های ایرانی است که با زمینه قرمز رنگ و طرح‌های زیبایی ، تولید شده از ابریشم می‌باشد که موجب محبوبیت بالای آن شده است.</li><li style=\"text-align:justify;\"><strong>قالی چلسی :</strong> یکی دیگر از فرش‌های زیبای جهان قالی چلسی است که در مجموعه فرش‌های موزه ویکتوریا و آلبرت لندن نگهداری می‌شود.</li></ol><ul><li style=\"text-align:justify;\"><br data-cke-filler=\"true\"></li></ul><h3 style=\"text-align:justify;\">مواد به کار رفته در فرش دستباف</h3><p style=\"text-align:justify;\">یکی از شاخص‌ترین مواردی که موجب محبوبیت و مشهوریت فرش دستباف ایرانی شده است مواد مصرف شده در این قالی‌ها است که دارای کیفیت و مرغوبیت بسیار بالایی هستند و این امر در کنار زیبایی محصول مورد اهمیت می‌باشد. یکی از مواد به کار رفته در تار و پود فرش دستبافت ایرانی پنبه و پشم می‌باشد که این نوع فرش و قالی به فرش یا قالی پشمی مشهور است. همچنین می‌توان گفت در میان عشایر به جای نخ از پشم استفاده می‌شود.</p><h3 style=\"text-align:justify;\">انواع فرش دستباف</h3><p style=\"text-align:justify;\">از انواع فرش دستباف می‌توان به موارد زیر اشاره کرد :</p><ol><li style=\"text-align:justify;\"><strong>قالی تمام ابریشم :</strong> پرز و چله آن از نخ ابریشم مرغوب بافته شده است.</li><li style=\"text-align:justify;\"><strong>گل ابریشم :</strong> &nbsp;نوع دیگری از فرش یا قالی دستباف است که در دوره حاشیه‌ها و در نقش‌های آن به جای پرز پشمی ، از ابریشم استفاده می‌شود.</li><li style=\"text-align:justify;\"><strong>قالی کف ابریشم :</strong> نوع دیگری از فرش دستباف است که در زمینه آن به جای پشم از ابریشم استفاده می‌شود.</li><li style=\"text-align:justify;\"><strong>سوف :</strong> نوع دیگری از فرش و قالی دستباف است که زمینه آن از پود ضخیم و نازک تشکیل شده است و نقش و گل و بوته پرزدار دارد.</li></ol><ul><li style=\"text-align:justify;\"><br data-cke-filler=\"true\"></li></ul>',0,0,0,'فرش_دستباف_12_متری_پورمعمار_مدل_شکارگاه_کد_110',0,'2022-10-15 15:02:02',NULL,NULL),(12,'فرش دستبافت نه و نیم متری اصفهان آبتین کد 4','درخواست مرجوع کردن کالا در گروه فرش دستبافت با دلیل \"انصراف از خرید\" تنها در صورتی قابل تایید است که کالا در شرایط اولیه باشد (در صور